import React from 'react';
import '../Styles/Header.css'

const Header = () => {
    return(
        <div>
            <div id = "box">
            <h1>Twitter</h1>
            <p>Profile Name</p>
            <p>3/19/2023</p>
            <p>Trending</p>
            </div>
        </div>

    )
}

export default Header;
